	function processSelector(index, RGB) {
		if(!(index == 13)) {
			position = Math.floor((index - 1)*(978 / 12));
			deltaPos = Math.abs(currentPos - position);
			mPos = (index - 1) * 978;
		}
		var d1, d2, c1, c2, h1, h2;
		var Direction = 1;
		var time = 2*deltaPos;
		
		if( currentPos - position <= 0 )
			Direction *= -1;
		
		d1 = position + 0.05 * deltaPos * Direction;
		d2 = position - 0.01 * deltaPos * Direction;

		if(RGB == 3) {
			currentHover = currentPos;
			$(".selectorBoxG").queue("fx", []).stop().animate({left:currentHover+'px'},200);
		} else if(RGB == 2) {
			currentPos = position;
			$(".selectorBoxR").queue("fx", []).stop().animate({left:d1+'px'}, 100).animate({left:d2+'px'},50).animate({left:position+'px'},25);
			$(".bGround").queue("fx", []).stop().animate({left:-mPos+'px'}, time + 100);
			$(".fGround").queue("fx", []).stop().animate({right:-mPos+'px'}, time);
			$(".scene").queue("fx", []).stop().animate({left:-(mPos/10)+'px'}, time);
		} else if(RGB == 0) {
			currentHover = position;
			$(".selectorBoxG").queue("fx", []).stop().animate({left:position+'px'},175);
		}
	}
